  `address_no` varchar(10) NOT NULL,
  `address_lane` varchar(40) NOT NULL,
  `address_city` varchar(30) NOT NULL,
  PRIMARY KEY (`address_id`)
) ENGINE=InnoDB AUTO_INCREMENT=255 DEFAULT CHARSET=utf8;

/*Data for the table `address` */

insert  into `address`(`address_id`,`address_no`,`address_lane`,`address_city`) values (253,'3/15A','Gangarama Road','Piliyandala'),(254,'25','imbulgoda','gampaha');

/*Table structure for table `blog_post` */

DROP TABLE IF EXISTS `blog_post`;

CREATE TABLE `blog_post` (
  `created_date_time` datetime NOT NULL,
  `title` varchar(256) NOT NULL,
  `description` varchar(400) NOT NULL,
  `post` longblob NOT NULL,
